import React, {Component} from 'react';
import Miniaboutui from "./Miniaboutui";

class AboutUi extends Component {
    render() {
        return (
            <div class="how-section1">
                <Miniaboutui uiimgtop="../img/respon.jpg" uititletop="Tương thích với mọi thiết bị" uicontenttop="" uititlebot="Đa dạng thể loại" uicontentbot="" uiimgbot="../img/catermore.jpg"/>
                <Miniaboutui uiimgtop="../img/uppspeed.jpg" uititletop="Tốc đọ tải trang cực nhanh" uicontenttop="" uititlebot="Giá hấp dẫn nhất" uicontentbot="" uiimgbot="../img/price.jpg"/>
            </div>
        );
    }
}

export default AboutUi;
